import React from "react";

const TeamMemberCard = props => {
  return (
    <div className="team-card">
      {props.teamCards.map(card => (
        <div className="card" key={card.id}>
          <h2>{card.name}</h2>
        </div>
      ))}
    </div>
  );
};

export default Notes;
